import React from 'react';
import { motion } from 'framer-motion';
import { useTet } from '../contexts/TetContext';

export const TetOverlay = () => {
  const { isTetEnabled } = useTet();
  if (!isTetEnabled) return null;

  return (
    <div className="fixed inset-0 pointer-events-none z-50">
      {/* Hoa Mai r∆°i */}
      {[...Array(15)].map((_, i) => (
        <motion.div
          key={i}
          initial={{ 
            x: Math.random() * window.innerWidth,
            y: -50,
            rotate: 0 
          }}
          animate={{ 
            y: window.innerHeight + 50,
            rotate: 360,
            opacity: [0, 1, 1, 0]
          }}
          transition={{
            duration: Math.random() * 3 + 2,
            repeat: Infinity,
            delay: Math.random() * 2
          }}
          className="absolute text-2xl"
        >
          {Math.random() > 0.5 ? 'üå∏' : 'üå∫'}
        </motion.div>
      ))}

      {/* ƒê√®n l·ªìng g√≥c */}
      <motion.div
        animate={{ y: [0, -10, 0] }}
        transition={{ duration: 2, repeat: Infinity }}
        className="fixed top-20 left-10"
      >
        <span className="text-6xl">üèÆ</span>
      </motion.div>
      <motion.div
        animate={{ y: [0, 10, 0] }}
        transition={{ duration: 2, repeat: Infinity }}
        className="fixed top-20 right-10"
      >
        <span className="text-6xl">üèÆ</span>
      </motion.div>
    </div>
  );
};
